import React from "react";
import NoteContext from "./noteContext";
import { useState } from "react";

const NoteState  = (props) => {
      const notes = [
        {
          "_id": "663db850783a0b53a60f6f34",
          "user": "663d328453ffc66153aad4a5",
          "title": "updated",
          "description": "Coplete react course",
          "tag": "personal",
          "date": "2024-05-10T06:01:52.090Z",
          "__v": 0
        },
        {
          "_id": "663db88e783a0b53a60f6f38",
          "user": "663d328453ffc66153aad4a5",
          "title": "My Routine",
          "description": "studing",
          "tag": "personal",
          "date": "2024-05-10T06:02:54.595Z",
          "__v": 0
        },
        {
          "_id": "663dc5d6e85b3537cf23af7b",
          "user": "663d328453ffc66153aad4a5",
          "title": "My Routine",
          "description": "studing",
          "tag": "personal",
          "date": "2024-05-10T06:59:34.821Z",
          "__v": 0
        }
      ]
return(
    <NoteContext.Provider value = {{notes}}>
        {props.children}
    </NoteContext.Provider>
    )
}

export default NoteState;
